import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  useParams,
  useLocation,
  useHistory,
  Link
} from "react-router-dom";
function Index() {
  return <h2>home</h2>;
}
function List() {
  return <h2>List</h2>;
}
function List2() {
  return <h2>List2</h2>;
}
function list() {
  return (
    <div>
      {/* <Link to="/">首页</Link> <Link to="/list/">列表</Link>{" "} */}
      <Route path="/" exact component={Index} />
      <Route path="/li" component={List} />
      <Route path="/li/2" component={List2} />
    </div>
  );
}
export default list;
